contract Poker {
    using GameUtils for Game;

    uint lastGameId = 0;
    mapping(uint => Game) private gameToDeck;

    function createGame() external {
        gameToDeck[lastGameId++] = GameUtils.create();
    }

    function joinGame(uint gameId) external {
        gameToDeck[gameId].join(msg.sender);
    }

}

